But had the same error:
```
Number of inputs = 1
Input 0 : name=input
Input 0 : type=1
Input 0 : num_dims=3
Input 0 : dim 0=1
Input 0 : dim 1=28
Input 0 : dim 2=28
not enough space: expected 2159856865918044160, got 3136
```

There are two different representations, and in the original issue (IIRC) the issue I mentioned was with the value set for the dimension in the model.

The value in the model can be one of 3 things. A dim_value (int), a dim_param (symbolic name) or unknown (neither dim_value nor dim_param). -1 is not a valid value for dim_value. In the model a symbolic dimension should either have a name in dim_param (e.g. 'batch') or be unknown.

Internally in ORT we process the model and handle cases where there is not a dim_value. We internally represent the dim_value as -1 in some data structures. That is what you're seeing returned in the example code as input_node_dims is a vector of int64.

If you were to look at the model in Netron you should be able to see the original values. Or you could print them out using python

```
for input in model.graph.input:
    print(input.name)
    for dim in input.type.tensor_type.shape.dim:
        if dim.HasField('dim_param'):
            print(dim.dim_param)
        elif dim.HasField('dim_value'):
            print(dim.dim_value)
        else:
            print('unknown')

```
